{"code":"# Collected pricing data from Apple education stores
# iPad Pro 11-inch 256GB + Apple Pencil Pro

regions_data = {
    "United States": {
        "ipad_pro_256gb": 899,  # USD
        "apple_pencil_pro": 119,  # USD
        "currency": "USD"
    },
    "Hong Kong": {
        "ipad_pro_256gb": 7199,  # HKD
        "apple_pencil_pro": 899,  # HKD
        "currency": "HKD"
    },
    "Singapore": {
        "ipad_pro_256gb": 1349,  # SGD
        "apple_pencil_pro": 179,  # SGD
        "currency": "SGD"
    },
    "Mainland China": {
        "ipad_pro_256gb": 8099,  # RMB/CNY
        "apple_pencil_pro": 899,  # RMB/CNY
        "currency": "CNY"
    }
}

# Current exchange rates (approximate, as of 2024)
exchange_rates_to_usd = {
    "USD": 1.0,
    "HKD": 0.128,  # 1 HKD = 0.128 USD
    "SGD": 0.74,   # 1 SGD = 0.74 USD
    "CNY": 0.14    # 1 CNY = 0.14 USD
}

# Calculate total prices in USD for comparison
results = {}

for region, data in regions_data.items():
    ipad_price = data["ipad_pro_256gb"]
    pencil_price = data["apple_pencil_pro"]
    currency = data["currency"]

    total_local = ipad_price + pencil_price
    total_usd = total_local * exchange_rates_to_usd[currency]

    results[region] = {
        "total_local_price": total_local,
        "local_currency": currency,
        "total_usd_price": round(total_usd, 2)
    }

    print(f"{region}:")
    print(f"  iPad Pro 256GB: {ipad_price} {currency}")
    print(f"  Apple Pencil Pro: {pencil_price} {currency}")
    print(f"  Total: {total_local} {currency} = ${total_usd:.2f} USD")
    print()

# Find the cheapest region
cheapest_region = min(results.keys(), key=lambda x: results[x]["total_usd_price"])
cheapest_price = results[cheapest_region]["total_usd_price"]

print(f"Cheapest region: {cheapest_region}")
print(f"Cheapest total price: ${cheapest_price} USD")

# Show all prices sorted by USD equivalent
print("\nAll regions sorted by price (USD equivalent):")
sorted_regions = sorted(results.items(), key=lambda x: x[1]["total_usd_price"])
for region, data in sorted_regions:
    print(f"{region}: {data['total_local_price']} {data['local_currency']} = ${data['total_usd_price']} USD")"}
